import React from 'react';
import Avatar from '@mui/material/Avatar';
import { makeStyles } from '@mui/material/styles';

const useStyles = makeStyles({
    container: {
        width: '200px',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        position: 'relative'
    }
});

function User({user}) {

    const classes = useStyles();

    return (


        <div className={classes.container}>  
            <Avatar alt="Avatar Image" src={"http://127.0.0.1:8000"+user.profile.image} sx={{ width: 200, height: 200 }}/>
            <p>{user.username}</p> 
        </div>
    )
}

export default User;
